import './App.css';
import NavBar from './component/NavBar';
import {browserRouter as router, Switch, Route, Router} from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <NavBar />
          <Route path='/' exact component={Home} />
      </Router>
    </>
  );
}

export default App;
